import React, {useState} from 'react';
import classes from './css.modules/AddHistory.module.css'
import plus_white from '../assets/plus.png'
import plus_black from '../assets/plus_black.png'

const AddHistory = () => {
    const [img, setImg] = useState(plus_white)
    return (
        <div className={classes.moduleButton} onMouseOver={() => setImg(plus_white)} onMouseOut={() => setImg(plus_black)}>
            <img src={img} alt=""/>
            <p>Добавить историю</p>
        </div>
    );
};

export default AddHistory;
